import { ACTION_TYPES } from "../../../constants/actionTypes";

export const productsLoadingAction = () => {
    return {
        type: ACTION_TYPES.PRODUCTS_LOADING,
    };
};

export const productsSuccessAction = (data) => {
    return {
        type: ACTION_TYPES.PRODUCTS_SUCCESS,
        payload: data,
    };
};

export const productsFailAction = (data) => {
    return {
        type: ACTION_TYPES.PRODUCTS_FAIL,
        payload: data,
    };
};
